    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE - 19 NOT BETWEEN - - col0 AND - + col0 * col1 * - 31 * - col1 * + - col2 + + col0;
  - name: tab2

outputs:
  - name: q8206.out
    data: |
      46	51	23
      64	77	40
      75	67	58
